pragma solidity ^0.8.24;

/**
 * @title CampaignVault
 * @notice Encrypted ledger per campaign - stores private donation totals
 * @dev Records encrypted donations and facilitates claims via public decryption
 */

import {FHE, euint128, externalEuint128, ebool} from "@fhevm/solidity/lib/FHE.sol";

interface IZLETHWrapper {
    /// @notice Returns encrypted balance handle for off-chain audit/debugging
    function balanceHandleOf(address user) external view returns (bytes32);

    /// @notice Vault-only withdrawal function for campaign claims
    /// @dev Reduces vault's ZLETH balance by amountWei and sends equivalent ETH to recipient (1:1)
    function withdrawForVault(uint128 amountWei, address to) external;
}

contract CampaignVault {
    // ====== Storage ======
    struct Campaign {
        address creator;
        euint128 total; /// @dev Encrypted total donations for this campaign
        bool exists;
    }

    /// @dev ZLETHWrapper contract address for fund management
    address public immutable wrapper;

    /// @dev Oracle address for public decryption operations
    address public immutable decryptionOracle;

    /// @dev Campaign data storage
    mapping(bytes32 => Campaign) private _campaigns;

    /// @dev Maps decryption requestId to campaignId for claim processing
    mapping(uint256 => bytes32) private _pendingClaim;

    /// @dev Simple reentrancy guard
    uint256 private _entered;

    // ====== Events ======
    event CampaignCreated(bytes32 indexed campaignId, address indexed creator);
    event DonationRecorded(bytes32 indexed campaignId, address indexed donor, bytes32 amountHandle);
    event ClaimRequested(bytes32 indexed campaignId, uint256 indexed requestId, bytes32 totalHandle);
    event Claimed(bytes32 indexed campaignId, address indexed creator, uint128 amountWei);

    // ====== Modifiers ======
    modifier nonReentrant() {
        require(_entered == 0, "REENTRANCY");
        _entered = 1;
        _;
        _entered = 0;
    }

    modifier onlyExisting(bytes32 campaignId) {
        require(_campaigns[campaignId].exists, "CAMPAIGN_NOT_FOUND");
        _;
    }

    constructor(address _wrapper, address _oracle) {
        require(_wrapper != address(0), "WRAPPER_ZERO");
        require(_oracle  != address(0), "ORACLE_ZERO");
        wrapper = _wrapper;
        decryptionOracle = _oracle;

        // Register decryption oracle for this contract (required for public decryption)
        FHE.setDecryptionOracle(_oracle);
    }

    // ====== Campaign Management ======

    /**
     * @notice Creates a new campaign with unique ID and creator address
     * @param campaignId Unique identifier for the campaign
     * @param creator Address of the campaign creator
     * @dev Initializes encrypted total to zero and sets up access permissions
     */
    function createCampaign(bytes32 campaignId, address creator) external nonReentrant {
        require(!_campaigns[campaignId].exists, "CAMPAIGN_EXISTS");
        require(creator != address(0), "CREATOR_ZERO");

        // Initialize encrypted total to zero
        euint128 zero = FHE.asEuint128(0);

        _campaigns[campaignId] = Campaign({
            creator: creator,
            total: zero,
            exists: true
        });

        // Grant access permissions to contract and creator
        FHE.allow(_campaigns[campaignId].total, address(this));
        FHE.allow(_campaigns[campaignId].total, creator);

        emit CampaignCreated(campaignId, creator);
    }

    // ====== Private Donations ======

    /**
     * @notice Records encrypted donation to campaign
     * @param campaignId Target campaign identifier
     * @param amountExt External encrypted donation amount
     * @param att Attestation data for encrypted input verification
     * @dev Requires prior ZLETH transfer to vault address via ZLETHWrapper.transfer()
     *      Uses same encrypted input to add to campaign total without revealing amount
     *      Separate transactions required due to FHE permission constraints with msg.sender
     */
    function donateZLETH(
        bytes32 campaignId,
        externalEuint128 amountExt,
        bytes calldata att
    ) external nonReentrant onlyExisting(campaignId) {
        // Import encrypted amount with attestation verification
        euint128 amount = FHE.fromExternal(amountExt, att);
        require(FHE.isSenderAllowed(amount), "NOT_ALLOWED");

        // Add encrypted amount to campaign total
        _campaigns[campaignId].total = FHE.add(_campaigns[campaignId].total, amount);

        // Update access control permissions for updated total
        FHE.allow(_campaigns[campaignId].total, address(this));
        FHE.allow(_campaigns[campaignId].total, _campaigns[campaignId].creator);

        emit DonationRecorded(campaignId, msg.sender, FHE.toBytes32(amount));
    }

    // ====== View Functions ======

    /**
     * @notice Returns encrypted total handle for a campaign
     * @param campaignId Campaign identifier
     * @return bytes32 handle for encrypted campaign total (for frontend userDecrypt)
     * @dev View function returns handle only, no FHE operations performed
     */
    function viewTotalHandle(bytes32 campaignId)
        external
        view
        onlyExisting(campaignId)
        returns (bytes32)
    {
        return FHE.toBytes32(_campaigns[campaignId].total);
    }

    // ====== Fund Claims ======

    /**
     * @notice Creator requests claim: vault decrypts total and sends ETH via wrapper
     * @param campaignId Campaign identifier to claim from
     * @return requestId Unique identifier for the decryption request
     * @dev Initiates public decryption process; oracle calls onClaimCallback with plaintext result
     *      Only campaign creator can initiate claims
     */
    function requestClaim(bytes32 campaignId)
        external
        nonReentrant
        onlyExisting(campaignId)
        returns (uint256 requestId)
    {
        require(msg.sender == _campaigns[campaignId].creator, "ONLY_CREATOR");

        // Mark campaign total as publicly decryptable
        FHE.makePubliclyDecryptable(_campaigns[campaignId].total);

        // Request decryption with callback selector
        bytes32[] memory cts = new bytes32[](1);
        cts[0] = FHE.toBytes32(_campaigns[campaignId].total);

        requestId = FHE.requestDecryption(cts, this.onClaimCallback.selector);
        _pendingClaim[requestId] = campaignId;

        emit ClaimRequested(campaignId, requestId, cts[0]);
    }

    /**
     * @notice Oracle callback: processes claim after decryption and instructs wrapper to send ETH
     * @param requestId Unique decryption request identifier
     * @param amountWei Decrypted campaign total in wei
     * @param signatures KMS signatures for verification
     * @dev Protected by oracle-only access and KMS signature verification
     *      Reduces encrypted campaign total by claimed amount (typically to zero)
     *      Instructs wrapper to unwrap ZLETH and send ETH to creator
     */
    function onClaimCallback(
        uint256 requestId,
        uint128 amountWei,
        bytes[] calldata signatures
    ) external nonReentrant {
        require(msg.sender == decryptionOracle, "ONLY_ORACLE");
        FHE.checkSignatures(requestId, signatures);

        bytes32 campaignId = _pendingClaim[requestId];
        require(_campaigns[campaignId].exists, "CLAIM_UNKNOWN");
        delete _pendingClaim[requestId];

        address creator = _campaigns[campaignId].creator;

        // Reduce encrypted campaign total by claimed amount
        euint128 v = FHE.asEuint128(amountWei);
        _campaigns[campaignId].total = FHE.sub(_campaigns[campaignId].total, v);

        // Update access control permissions
        FHE.allow(_campaigns[campaignId].total, address(this));
        FHE.allow(_campaigns[campaignId].total, creator);

        // Instruct wrapper to unwrap ZLETH and send ETH to creator (1:1 ratio)
        IZLETHWrapper(wrapper).withdrawForVault(amountWei, creator);

        emit Claimed(campaignId, creator, amountWei);
    }
}
